case class packageClass(packName:String , n:Int, i:Int, st:String, packResults:String)

var packageArray=Array[packageClass]()

def getValue(arg: String, inputMap:scala.collection.Map[String, Long] ) = inputMap get arg match {
  case Some(result) => result.toString
  case None =>
    "0"
}

def getValueDouble(arg: String, inputMap:scala.collection.Map[String, Double] ) = inputMap get arg match {
  case Some(result) => result.toString
  case None =>
    "0"
}

var Nth= 1 to 20 /// change to 25
val SampleSize = Seq(1000,5000,10000)
//val SampleSize = Seq(10)


val mk_array = Array("VERIZON","SPRINT","U.S. CELLULAR","T-MOBILE","OTHER","AT&T")

var allpackageResults = ArrayBuffer[String]()
for (packName <- packages)
{// package

        for (n <- SampleSize)
        {// sample size
                for(i<- Nth)
                {// iteration 1..25 
                        //println(packName, n, i)
                        var packageResults = ArrayBuffer[String]()
                        val sampledByPackage = testCar.filter($"pack" === packName)
                        val sampledDF = sampledByPackage.rdd.takeSample(true, n).map(row=>(row.getAs[String]("maid"),row.getAs[String]("pack"))).toSeq.toDF("maid","pack")
                        val joinedSampledDF = sampledDF.join(truthCarWfDf, "maid").select(sampledDF("maid"),sampledDF("pack"),truthCarWfDf("carrier"), truthCarWfDf("weights"))//maid, pack, carrier, weights
                        //joinedSampledDF.show(10)

                        val st = sampledByPackage.count().toString().concat(",").concat(joinedSampledDF.count().toString())
                        //sampledByPackage.show(10)
                        //println("st =" + st)
                        val wc_columnsMap = joinedSampledDF.groupBy("carrier").agg(count("*").alias("cnt")).orderBy("carrier").toDF.rdd.map(row =>(row.getString(0), row.getLong(1))).collectAsMap()
                        //println("map")
                        //mk_columnsMap foreach ( (row) =>  println(row._1, row._2))

                        val weight_wc_columnsMap = joinedSampledDF.groupBy("carrier").agg(sum("weights").alias("sum_wt_carrtype")).orderBy("carrier").toDF.rdd.map(row =>(row.getString(0), row.getDouble(1))).collectAsMap()

                        //weight_mk_columnsMap foreach( (row) =>  println(row._1, row._2))

                        for (element  <- mk_array)
                        {
                            println("wc_columnsMap = " +  getValue(element, wc_columnsMap))
                            packageResults :+= getValue(element, wc_columnsMap )
                        }

                        for(element  <- mk_array) {
                            println("weight_mk_columnsMap = " +  getValueDouble(element, weight_wc_columnsMap))
                            packageResults :+= getValueDouble(element, weight_wc_columnsMap)
                        }

                        println("count mk = " + packageResults.mkString(","))

                        packageArray :+= packageClass(packName, n, i, st,  packageResults.mkString(",")) 
                        packageResults.clear

                }

        }
}

var packageDF = spark.createDataFrame(packageArray)
packageDF.show(100)
packageDF.select("packResults").show(100, false)

